import React from 'react'
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
function App() {
    return (
        <div>
            <Box>
            <AppBar>Hi</AppBar>
            </Box>
            
        </div>
    )
}

export default App
